import s from './Users.module.css';
import userAvatar from '../../assets/img/null_avatar.png';
import React from 'react';
import {NavLink} from 'react-router-dom';
import {UserType} from '../../API';
import {Paginator} from '../../common/Paginator/Paginator';
import {User} from './User';

type UsersFnType = {
    thunkChangeCurrentPage: (currentPage: number, pageSize: number) => void
    totalUsersCount: number
    pageSize: number
    currentPage: number
    users: Array<UserType>
    thunkUnSubscribe: (id: string) => void
    thunkSubscribe: (id: string) => void
    followingInProgress: Array<null | string>
}

export const Users: React.FC<UsersFnType> = React.memo((
    {
        thunkChangeCurrentPage,
        totalUsersCount,
        pageSize,
        currentPage,
        users,
        thunkUnSubscribe,
        thunkSubscribe,
        followingInProgress,
    }) => {
    return <>
        <Paginator thunkChangeCurrentPage={thunkChangeCurrentPage} totalUsersCount={totalUsersCount} pageSize={pageSize}
                   currentPage={currentPage}
        />
        <User users={users} thunkUnSubscribe={thunkUnSubscribe} thunkSubscribe={thunkSubscribe}
              followingInProgress={followingInProgress}
        />
    </>
})
